import React from 'react';

function RowItemApp({row}) {
    return (
        <tr>
            <td>{row.name}</td>
            <td><img src={`../image2/${row.photo}.png`} style={{width:'60px',border:'1px solid gray',height:'80px'}}/></td>
            <td>{row.blood}í˜•</td>
            <td>{row.today.toLocaleDateString()}</td>
        </tr>
    );
}

export default RowItemApp;
